import React from "react";
import buttonImage from "../assets/button.svg";

const NavBar = () => {
  return (
    <>
    <nav className="top-nav-bar normal-color">
      <a href="">
        <img className="home-button" src={buttonImage} alt="Button" />
      </a>
      <input className="main-nav-search" type="text" placeholder=" Search">
        <input className="search-companion-nav" type="submit"></input>
      </input>

      <navside>
        <input type="button"></input>
        <input type="button"></input>
        <input type="button"></input>
      </navside>
    </nav>
    </>
  );
};

export default NavBar;

